import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const CustomerDashboard = () => {
  const [user, setUser] = useState(null);
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    // Get user data from localStorage
    const userData = localStorage.getItem('user');
    if (userData) {
      const parsedUser = JSON.parse(userData);
      setUser(parsedUser);
      
      // Check if user is actually a customer
      if (parsedUser.role !== 'CUSTOMER') {
        navigate('/');
        return;
      }
    } else {
      navigate('/login');
      return;
    }
    
    // Load customer orders (mock data for now)
    loadOrders();
  }, [navigate]);

  const loadOrders = () => {
    // Mock order data - replace with actual API call
    setTimeout(() => {
      setOrders([
        {
          id: 1,
          restaurant: 'Campus Canteen',
          items: ['Burger', 'Fries', 'Coke'],
          total: 15.99,
          status: 'Delivered',
          date: '2024-01-15'
        },
        {
          id: 2,
          restaurant: 'Pizza Corner',
          items: ['Margherita Pizza', 'Garlic Bread'],
          total: 22.50,
          status: 'In Progress',
          date: '2024-01-16'
        }
      ]);
      setLoading(false);
    }, 1000);
  };

  const handleBrowseRestaurants = () => {
    navigate('/restaurants');
  };

  const handleViewProfile = () => {
    navigate('/profile');
  };

  if (loading) {
    return (
      <div className="dashboard-container">
        <div className="loading">Loading your dashboard...</div>
      </div>
    );
  }

  return (
    <div className="dashboard-container customer-dashboard">
      <div className="dashboard-header">
        <div className="welcome-section">
          <h1>Welcome back, {user?.firstName}! üéì</h1>
          <p>Ready to order some delicious food?</p>
        </div>
        <div className="loyalty-section">
          <div className="loyalty-card">
            <h3>Loyalty Points</h3>
            <div className="points">{user?.loyaltyPoints || 0}</div>
            <p>Keep ordering to earn more points!</p>
          </div>
        </div>
      </div>

      <div className="dashboard-content">
        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <button className="action-btn browse-btn" onClick={handleBrowseRestaurants}>
              <span className="btn-icon">üçΩÔ∏è</span>
              <div>
                <h3>Browse Restaurants</h3>
                <p>Discover food options on campus</p>
              </div>
            </button>
            
            <button className="action-btn profile-btn" onClick={handleViewProfile}>
              <span className="btn-icon">üë§</span>
              <div>
                <h3>My Profile</h3>
                <p>Update your information</p>
              </div>
            </button>
          </div>
        </div>

        <div className="recent-orders">
          <h2>Recent Orders</h2>
          {orders.length > 0 ? (
            <div className="orders-list">
              {orders.map(order => (
                <div key={order.id} className="order-card">
                  <div className="order-header">
                    <h3>{order.restaurant}</h3>
                    <span className={`status ${order.status.toLowerCase().replace(' ', '-')}`}>
                      {order.status}
                    </span>
                  </div>
                  <div className="order-details">
                    <p><strong>Items:</strong> {order.items.join(', ')}</p>
                    <p><strong>Total:</strong> ${order.total}</p>
                    <p><strong>Date:</strong> {order.date}</p>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <div className="no-orders">
              <p>No orders yet. Start by browsing restaurants!</p>
              <button className="btn primary-btn" onClick={handleBrowseRestaurants}>
                Browse Restaurants
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default CustomerDashboard;
